import React, {Component} from  'react';

class Footer extends Component {
    constructor(){
        super();
    }
    render(){
        return (
            <div className="container">
              <hr/>
              <div className="row">
                <div className="col-md">About Us</div>
                <div className="col-md">Contact Us</div>
                <div className="col-md">Site Map</div>
              </div>
            </div>
        )
    }
}

export default Footer;
